import React from 'react';

const ProductList = ({ products, onEditProduct }) => {
  return (
    <div>
      <h2>Product List</h2>
      <ul>
        {products.length > 0 ? (
          products.map((product) => (
            <li key={product.id}>
              <strong>{product.name}</strong>
              <button
                onClick={() => onEditProduct(product.id)} // Chama a função de edição ao clicar
                style={{ marginLeft: '10px', cursor: 'pointer', textDecoration: 'underline' }}
              >
                Edit
              </button>
            </li>
          ))
        ) : (
          <p>No products available.</p>
        )}
      </ul>
    </div>
  );
};

export default ProductList;
